/*Table structure for table `cms_account_log` */

DROP TABLE IF EXISTS `cms_account_log`;

CREATE TABLE `cms_account_log` (
  `log_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL,
  `openid` varchar(250) NOT NULL COMMENT 'openid',
  `user_money` decimal(10,2) NOT NULL COMMENT '用户余额',
  `pay_points` mediumint(9) NOT NULL COMMENT '支付积分',
  `change_time` int(10) unsigned NOT NULL COMMENT '改变时间',
  `change_desc` varchar(255) NOT NULL COMMENT '描述',
  `change_type` tinyint(3) unsigned NOT NULL,
  PRIMARY KEY (`log_id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

