/*Table structure for table `cms_activity_apply` */

DROP TABLE IF EXISTS `cms_activity_apply`;

CREATE TABLE `cms_activity_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `act_id` int(11) NOT NULL COMMENT '活动ID',
  `weixin_key` varchar(64) CHARACTER SET utf8 NOT NULL COMMENT '微信ID',
  `username` varchar(16) CHARACTER SET utf8 NOT NULL COMMENT '用户名',
  `identity` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '身份证号',
  `tel` varchar(16) CHARACTER SET utf8 NOT NULL COMMENT '联系电话',
  `create_time` int(11) NOT NULL COMMENT '添加时间，报名时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COMMENT='活动报名表';

