/*Table structure for table `cms_admin` */

DROP TABLE IF EXISTS `cms_admin`;

CREATE TABLE `cms_admin` (
  `admin_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '管理员帐号ID',
  `imp_id` int(11) NOT NULL DEFAULT '0' COMMENT '导入用户ID',
  `account` varchar(50) NOT NULL COMMENT '登陆帐号',
  `password` varchar(60) NOT NULL COMMENT '密码',
  `status` tinyint(1) NOT NULL COMMENT '状态:0冻结,1正常',
  `admin_type` enum('admin','institutions') NOT NULL COMMENT '帐号类型,admin为橡树管理员,member合作站长',
  `admin_name` varchar(20) NOT NULL,
  `email` varchar(50) NOT NULL,
  `phone` varchar(16) NOT NULL,
  `qq` varchar(16) NOT NULL,
  `city_id` int(8) NOT NULL COMMENT '城市ID',
  `remark` varchar(128) NOT NULL COMMENT '备注',
  `temp_style` varchar(32) NOT NULL COMMENT '系统后台风格',
  `is_del` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`admin_id`),
  UNIQUE KEY `account` (`account`)
) ENGINE=MyISAM AUTO_INCREMENT=157 DEFAULT CHARSET=utf8 COMMENT='后台管理员帐号表  （记录登陆后台的用户名和密码-管理员/站长信息表 ）';

