/*Table structure for table `cms_app_menu` */

DROP TABLE IF EXISTS `cms_app_menu`;

CREATE TABLE `cms_app_menu` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL,
  `type` enum('click','view') NOT NULL DEFAULT 'click' COMMENT 'click点击事件，view url连接',
  `key_url` varchar(255) NOT NULL COMMENT 'key为消息回复KEY，url为连接地址',
  `pid` int(8) NOT NULL DEFAULT '0' COMMENT '父ID',
  `sort` int(8) NOT NULL DEFAULT '99' COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 不显示 1显示',
  `remark` text COMMENT '备注',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `is_del` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='微信菜单表';

