  `id` int(25) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `link` varchar(255) NOT NULL,
  `window` varchar(25) DEFAULT NULL,
  `is_del` enum('0','1') NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

/*Data for the table `cms_keywords` */

/*Table structure for table `cms_logadmin` */

DROP TABLE IF EXISTS `cms_logadmin`;

CREATE TABLE `cms_logadmin` (
  `log_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `admin_id` int(11) NOT NULL COMMENT '操作人',
  `module` varchar(32) NOT NULL COMMENT '模块',
