/*Table structure for table `cms_news` */

DROP TABLE IF EXISTS `cms_news`;

CREATE TABLE `cms_news` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `title` varchar(60) NOT NULL COMMENT '标题',
  `type_id` int(5) NOT NULL COMMENT '类型ID',
  `icon` varchar(64) NOT NULL COMMENT '图片',
  `source` varchar(60) NOT NULL COMMENT '来源',
  `news_url` varchar(128) NOT NULL COMMENT '如果URL不为空的话就跳到URL这里',
  `is_home` tinyint(1) NOT NULL DEFAULT '0' COMMENT '首页推荐 0:是 1:否',
  `content` text NOT NULL COMMENT '详细内容',
  `sort` smallint(5) NOT NULL COMMENT '排序',
  `create_time` int(10) NOT NULL COMMENT '新增时间',
  `update_time` int(10) NOT NULL COMMENT '更新时间',
  `seo_key` text NOT NULL COMMENT '优化关键字',
  `seo_desc` text NOT NULL COMMENT '优化描述内容',
  `status` tinyint(1) NOT NULL COMMENT '状态0无效，1有效',
  `click_num` int(11) NOT NULL DEFAULT '0' COMMENT '点击数',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未删除，1已删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='运营平台新闻表';

