/*Table structure for table `cms_newstype` */

DROP TABLE IF EXISTS `cms_newstype`;

CREATE TABLE `cms_newstype` (
  `type_id` int(5) NOT NULL AUTO_INCREMENT COMMENT '分类ID',
  `type_name` varchar(30) NOT NULL COMMENT '分类名称',
  `url` varchar(128) NOT NULL COMMENT '连接地址',
  `pid` int(5) NOT NULL COMMENT '父ID',
  `sort` smallint(6) NOT NULL COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否显示，0不显示，1显示',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未删除，1已删除',
  `keywords` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `click_num` int(11) NOT NULL DEFAULT '0' COMMENT '点击数',
  PRIMARY KEY (`type_id`)
) ENGINE=MyISAM AUTO_INCREMENT=93 DEFAULT CHARSET=utf8 COMMENT='运营平台新闻分类表  （运营平台新闻公告分类 ）';

