/*Table structure for table `cms_orders` */

DROP TABLE IF EXISTS `cms_orders`;

CREATE TABLE `cms_orders` (
  `orders_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `orders_no` varchar(22) NOT NULL COMMENT '订单号',
  `sub_id` int(11) NOT NULL COMMENT '用户ID',
  `openid` varchar(64) NOT NULL DEFAULT '',
  `amount` decimal(10,2) NOT NULL COMMENT '订单总额',
  `freight_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `remark` varchar(128) NOT NULL COMMENT '订单备注',
  `orders_status` tinyint(1) NOT NULL COMMENT '0- 未处理 1- 商家已发货 2- 用户已收货 3- 订单完成',
  `trade_no` varchar(250) DEFAULT NULL,
  `pay_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付状态,0未支付,1已支付',
  `transaction_id` int(11) DEFAULT NULL COMMENT '微信支付单号',
  `payway_id` int(5) NOT NULL DEFAULT '0' COMMENT '支付方式',
  `pay_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '支付类付，1在线支付，2货到付款',
  `user_ip` char(15) DEFAULT NULL,
  `create_time` int(11) NOT NULL COMMENT '订单时间表',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0未删1删除',
  `pay_time` datetime NOT NULL COMMENT '付款时间',
  `add_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货地址外键',
  `user_address` text NOT NULL COMMENT '收货地址,JSON保存',
  `admin_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '操作人',
  `consignee` varchar(250) NOT NULL COMMENT '收件人',
  `tel` varchar(50) NOT NULL COMMENT '电话',
  `province_id` int(11) DEFAULT NULL COMMENT '省',
  `city_id` int(11) DEFAULT NULL COMMENT '城市',
  `district_id` int(11) DEFAULT NULL COMMENT '区县',
  `address` varchar(500) DEFAULT NULL COMMENT '地址',
  `send_date` varchar(200) DEFAULT NULL COMMENT '配送日期',
  `send_time` varchar(200) DEFAULT NULL COMMENT '配送时间',
  `shop_id` int(11) DEFAULT NULL COMMENT '所属堂食还是外卖',
  `fstcreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`orders_id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8 COMMENT='订单表';

