/*Table structure for table `cms_vip_define` */

DROP TABLE IF EXISTS `cms_vip_define`;

CREATE TABLE `cms_vip_define` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL COMMENT '会员等级',
  `min_score` int(11) NOT NULL COMMENT '最小积分',
  `chongzhi_zhekou` float NOT NULL DEFAULT '1' COMMENT '0-1之间，1为0折扣，0为免费',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='VIP等级表';

